import { StyleSheet } from "aphrodite";
const styles = StyleSheet.create({
  mainWrap: {
    marginTop: "60px"
  },
  wrap: {
    padding: "0 20px"
  },
  img: {
    width: "100%"
  },
  t1: {
    fontFamily: "SFUIDisplay-Light",
    fontSize: "15px",
    fontWeight: 300,
    lineHeight: "30px"
  },
  t2: {
    fontFamily: "SFUIDisplay-Light",
    fontSize: "15px",
    fontWeight: 300,
    lineHeight: "30px"
  },
  t3: {
    marginTop: "80px",
    fontFamily: "SFUIDisplay-Light",
    fontWeight: 300,
    lineHeight: "30px",
    fontSize: "15px"
  },
  t4: {
    fontFamily: "SFUIDisplay-Bold",
    fontSize: "15px",
    lineHeight: "30px",
    fontWeight: 700,
    marginTop: "80px",
    marginBottom: "20px"
  }
});
export default styles;
